import React, { useEffect, useState } from 'react';
import * as XLSX from 'xlsx';
import { FaArrowLeft } from 'react-icons/fa';
import { useNavigate } from 'react-router-dom'; // optional, if using routing

export default function EngineSearch() {
  const [searchTerm, setSearchTerm] = useState('');
  const [groupedResults, setGroupedResults] = useState({});
  const [allData, setAllData] = useState([]);

  // Optional: if you're using React Router for navigation
  const navigate = useNavigate();

  // Load multiple Excel files
  useEffect(() => {
    const loadExcel = async (url, label) => {
      try {
        const res = await fetch(url);
        const arrayBuffer = await res.arrayBuffer();
        const workbook = XLSX.read(arrayBuffer, { type: 'array' });

        let combined = [];
        workbook.SheetNames.forEach(sheetName => {
          const sheet = workbook.Sheets[sheetName];
          const rows = XLSX.utils.sheet_to_json(sheet);

          rows.forEach(row => {
            combined.push({
              source: label,
              sheet: sheetName,
              ...row,
            });
          });
        });

        return combined;
      } catch (err) {
        console.error(`Error loading ${url}:`, err);
        return [];
      }
    };

    const loadAllData = async () => {
      const engines = await loadExcel('/engines.xlsx', 'Engines');
      const sparkplugs = await loadExcel('/sparkplugs.xlsx', 'Spark Plugs');
      // Add more files here as needed
      setAllData([...engines, ...sparkplugs]);
    };

    loadAllData();
  }, []);

  // Filter and group search results
  useEffect(() => {
    const term = searchTerm.toLowerCase();
    const filtered = allData.filter(row =>
      Object.values(row).some(val =>
        String(val).toLowerCase().includes(term)
      )
    );

    const grouped = filtered.reduce((acc, item) => {
      const key = `${item.source} - ${item.sheet}`;
      if (!acc[key]) acc[key] = [];
      acc[key].push(item);
      return acc;
    }, {});

    setGroupedResults(grouped);
  }, [searchTerm, allData]);

  return (
    <div className="max-w-5xl mx-auto px-4 py-8">
      {/* Back button */}
      <button
        className="flex items-center text-blue-600 mb-6 hover:underline"
        onClick={() => navigate(-1)} // or use history.back() if not using react-router
      >
        <FaArrowLeft className="mr-2" />
        Back
      </button>

      <h2 className="text-3xl font-bold mb-6 text-center text-gray-800">
        Search Engine & Spark Plug Parts
      </h2>

      <input
        type="text"
        placeholder="Search by engine, OE ref, frane, or any detail..."
        value={searchTerm}
        onChange={e => setSearchTerm(e.target.value)}
        className="w-full p-3 rounded-xl border border-gray-300 shadow-sm focus:ring-2 focus:ring-blue-400 mb-8"
      />

      {Object.keys(groupedResults).length > 0 ? (
        <div className="space-y-10">
          {Object.entries(groupedResults).map(([groupName, items]) => (
            <div key={groupName}>
              <h3 className="text-xl font-semibold text-blue-700 mb-3 border-b pb-1">
                {groupName}
              </h3>
              <div className="grid grid-cols-1 sm:grid-cols-2 gap-6">
                {items.map((item, idx) => (
                  <div
                    key={idx}
                    className="bg-white rounded-xl p-5 shadow hover:shadow-md transition border border-gray-100"
                  >
                    {/* Highlight title field if any */}
                    {(() => {
                      const titleField = Object.entries(item).find(
                        ([key, val]) =>
                          key.toLowerCase().includes('part') ||
                          key.toLowerCase().includes('description')
                      );
                      return titleField ? (
                        <h4 className="text-lg font-semibold text-blue-800 mb-1">
                          {titleField[1]}
                        </h4>
                      ) : null;
                    })()}

                    <ul className="text-sm text-gray-700 space-y-1">
                      {Object.entries(item).map(([key, val]) => {
                        if (['source', 'sheet'].includes(key)) return null;
                        return (
                          <li key={key}>
                            <strong>{key}:</strong> {String(val)}
                          </li>
                        );
                      })}
                    </ul>

                    <div className="text-xs text-gray-400 mt-2">
                      Source: {item.source} / {item.sheet}
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>
      ) : (
        <p className="text-center text-gray-500 italic">No matching results</p>
      )}
    </div>
  );
}
